B.yp=A.a(s(["[This is a Choose Your Own Adventure alternate ending to _A White Heron_. Sylvia has given away the heron's secret. Choose carefully, she may be able to save the heron yet!]","The murmur of the pine\u2019s green branches is in her ears, she remembers how the white heron came flying through the golden air and how they watched the sea and the morning together, and Sylvia wonders whether the stranger would think differently of the birds if he could only see what she had.","As she recounts all the sights of the morning, the stranger listens with a patient excitement. Sylvia tells of the great tree, that glimmering sunlight on the waves, and the white heron nesting in that endless greenery. That narrowing of his eyes, that sudden flash of color in his cheeks might betray a certain eagerness, but Sylvia, too enthralled in narrating that most mystical scene, does not see it.","\u201cI must find it!\u201d he finally exclaims after the child has finished explaining the way to the heron\u2019s nest. \u201cIt would mean much if you would join me.\u201d"]),t.f)
