B.Bf=new A.ak(2,{body:B.yp,choices:B.yJ},B.I,t.n)
B.xx=A.a(s(["Sylvia, unable to resist the young man's enthralling gaze, accepts this offer in a hushed whisper. Grinning with delight at the thought of bringing home such a prize as the white heron, the young man leads her along the meadow path to woods, his steps quick with excitement. The child follows only a few steps behind, the man's soft whispers about the wondrous heron enrapturing her soul with a great awe.",u.Q,u.k]),t.f)
B.yZ=A.a(s(["Follow the hunter","a3"]),t.s)
B.kr=A.a(s([B.yZ]),t.f)
B.Bi=new A.ak(2,{body:B.xx,choices:B.kr},B.I,t.n)
B.yP=A.a(s(["But now, Sylvia remembers the gun, and how the hunter felled those birds just the day before. Her heart pounding in her chest, she can do nothing but flee into the forest, mind racing with panic. She cannot bear the thought of the hunter finding the heron's nest and taking its life.","The child nestles against the trunk of that great tree, the familiar sounds of the forest all around her offering some solace, but also reminding her of the heron\u2019s great peril. She stops to catch her breath, her thoughts confused. Is it too late to save the heron?","In the forest, Sylvia feels a sense of belonging and safety that she had not felt in the presence of the hunter. The vastness of the woods and the company of the rustling leaves and singing birds offer her a sense of solace and comfort that she cannot find elsewhere. Against the hunter, she feels small and helpless, like a fragile bird facing a predator far more powerful than herself."]),t.f)
B.yS=A.a(s(["Stay in the forest","b2"]),t.s)
B.xO=A.a(s(["Find the hunter","i2"]),t.s)
B.xt=A.a(s([B.yS,B.xO]),t.f)
B.B6=new A.ak(2,{body:B.yP,choices:B.xt},B.I,t.n)
B.xW=A.a(s(["Deciding that she must save the bird, Sylvia makes for her grandmother\u2019s home. On her way, she finds the hunter in the meadow, and hesitantly makes her way to him. \u201cI must come with you,\u201d she says, her voice quivering slightly. He turns around, a small smile spreads across his face. \u201cGood,\u201d he says. \u201cI could use your help.\u201d And with that, they set off towards the heron's nest, their footsteps crunching in the grass as they go.","Grinning with delight at the thought of bringing home such a prize as the white heron, the young man leads her along the meadow path to woods, his steps quick with excitement. The child follows only a few steps behind, the man's soft whispers about the wondrous heron enrapturing her soul with a great awe.",u.Q,u.k]),t.f)
B.Bh=new A.ak(2,{body:B.xW,choices:B.kr},B.I,t.n)
B.x5=A.a(s(["Startled by a sudden thunderclap from the young man\u2019s gun, Sylvia forgets about the stillness of the forest. She stands frozen as the hunter rushes towards the shade of a great fir tree, stooping over the red-streaked form of a bluebird. Even from a distance, the child can see the now-lifeless body, the bird\u2019s head twisted back as if to preen its feathers. Even in his haste to find the white heron, the boy takes his time to carefully wrap the bluebird in a handkerchief. He could possess both the bluebird and the white heron, and he was keenly aware of it.",u.D]),t.f)
B.xs=A.a(s(["Talk to the hunter","a4"]),t.s)
B.z2=A.a(s(["Stay silent","e1"]),t.s)
B.kt=A.a(s([B.xs,B.z2]),t.f)
B.Ba=new A.ak(2,{body:B.x5,choices:B.kt},B.I,t.n)
B.y6=A.a(s(["Her back against the tree and deep in her thoughts, Sylvia is suddenly startled by a loud thunderclap. Recognizing the sound as a shot from the young man\u2019s gun, she jumps to her feet. With trepidation in her heart, the child forgets about the gayety of the forest. Rushing towards the source of the sound, she finds the hunter under the shade of a great fir tree, stooping over the red-streaked form of a bluebird. ","Even from a distance, the child can see the now-lifeless body, the bird\u2019s head twisted back as if to preen its feathers. Even in his haste to find the white heron, the boy takes his time to carefully wrap the bluebird in a handkerchief. He could possess both the bluebird and the white heron, and he was keenly aware of it.",u.D]),t.f)
B.Bb=new A.ak(2,{body:B.y6,choices:B.kt},B.I,t.n)
B.yo=A.a(s(["Though speaking up to the hunter is a prospect that fills Sylvia with dread, she now musters up all the courage she possesses. \u201cMust you really shoot the heron? Would it not be better to let it live and fly free?\u201d","The hunter faces about, perhaps surprised to hear the child\u2019s voice. But he looks at her only as teacher might when lecturing to a pupil, one who does not yet fully grasp the ways of the woods and the world beyond. \u201cThe bird could meet a gruesome end at the claws of some predator tomorrow,\u201d he explains slowly. \u201cBut if I can provide it a quick and painless end now, it will be preserved and admired by all, its beauty immortalized forever.\u201d","Try as she might, Sylvia cannot bring herself to make any sense of what the hunter had said. But she has exhausted all her courage and knows that additional words will make no difference. And so, with her heart heavy, she follows the hunter, like a dog obedient to its master, knowing they were now approaching the nest. Knowing what is to come is now inevitable.",u._]),t.f)
B.yg=A.a(s(["Stay","a5"]),t.s)
B.yx=A.a(s(["Run away","e2"]),t.s)
B.ky=A.a(s([B.yg,B.yx]),t.f)
B.Bk=new A.ak(2,{body:B.yo,choices:B.ky},B.I,t.n)
B.zh=A.a(s(["Silently, Sylvia trails behind the hunter. Speaking up to the young man is a prospect that fills Sylvia with dread. She knows she cannot bring herself to tell the hunter how she feels about his killing of the birds. Even if she could somehow pluck up that courage, she knows it will do no good. The hunter stays silent too, only occasionally asking only for directions towards the nest.",u._]),t.f)
B.B7=new A.ak(2,{body:B.zh,choices:B.ky},B.I,t.n)
B.ys=A.a(s(["Sylvia tries to run away now, her feet moving in an attempt to leap out of the clearing, but it is too late. The hunter's rifle is already pointed to the bird, his finger already on the trigger.",u.r]),t.f)
