B.ym=A.a(s(["The hunter departed that night, his prized white heron in hand, but having lost the admiration of a child who once held him in high regard. Even as she hears the echoes of the hunter's whistle fading in the distance for the next week, Sylvia\u2019s determination to ensure that no other creature suffers the same fate as the heron grows only stronger.","Whatever treasures were lost to her, woodlands and summer-time, remember! Bring your gifts and graces and tell your secrets to this lonely country child!","[Credit to Sarah Orne Jewett for _A White Heron_ and many of the phrases utilized within this alternate ending, other decisions and events are written by Dorian Cauwe (and chosen by you!), and are not part of the original story]"]),t.f)
