B.yR=A.a(s(["[This is a Choose Your Own Adventure alternate ending to _A Jury of Her Peers_.]","For a moment Mrs. Peters did not move. And then she did it. With a rush forward, she threw back the quilt pieces, got the box, tried to put it in her handbag. It was too big. Desperately she opened it, started to take the bird out. But there she broke--she could not touch the bird. She stood there helpless, foolish.","There was the sound of a knob turning in the inner door. Martha Hale tried snatching the box from the Mrs. Peter\u2019s hands. But the sheriff's wife had a strong grip on the box, and she only managed to drop the box onto the floor, its contents spilling out just as the sheriff himself and the county attorney came back into the kitchen.","Laughing at some joke, the men didn\u2019t seem to notice that mess on the floor at first, but their eyes quickly followed the women\u2019s gaze to the box, quilts, and silk cloth.","\u201cNow, what\u2019s this?\u201d exclaimed the county attorney, his gaze locked on the bird in the midst of that jumbled heap."]),t.f)
B.xU=A.a(s(["Continue","ja2"]),t.s)
