B.Be=new A.ak(2,{body:B.yR,choices:B.y0},B.I,t.n)
B.yk=A.a(s(["Both women had been frozen, mouths tense and rigid with tight faces pointed down and away from the men. But now, Mrs. Hale recovered, speaking with an uneven voice that trembled with emotion.","\u201cI\u2019ll clean up this mess here, I\u2019ll see to it now\u201d","Not daring to look at the men, she stooped down as if to pick up the bird, but a raised hand from the young attorney arrested her movement.","Crouching, the county attorney picked up the quilt from the floor and used it to wrap the bird\u2019s small form. Raising cupped hands to his face, he was careful not to directly touch the yellow plumage.","\u201cNo, I don\u2019t believe any cat did this,\u201d he finally exclaimed. \u201cLook here, Mr. Peters,\u201d he pointed to the canary\u2019s twisted head, \u201csomebody\u2019s wrung its neck, and has done it quite brutally, it seems.\u201d"]),t.f)
B.z4=A.a(s(["Say something","ja3"]),t.s)
B.yN=A.a(s(["Stay quiet","jb3"]),t.s)
B.x2=A.a(s([B.z4,B.yN]),t.f)
B.B5=new A.ak(2,{body:B.yk,choices:B.x2},B.I,t.n)
B.yY=A.a(s(["\u201cIt may have hit something,\u201d said Mrs. Hale quickly, \u201cI have seen many birds outside my own house looking much the same, necks broken from running into some wall or tree.\u201d She stole a quick glance at Mrs. Peters, but no help came from the sheriff\u2019s wife. Her face still pointed firmly at the ground, her blank expression suggesting she could hear nothing at all. ","Taking his gaze away from the bird, the attorney finally looked up at the women, a look of sudden comprehension crossed his face.","\u201cDo not let your sympathy for Mrs. Wright cloud your judgment so. We are here only to collect evidence, let the trial decide what happened here.\u201d Even so, his own face betrayed a certain assuredness, as if there was now no doubt in his mind as to why exactly the crime had been committed.",u.f,u.W]),t.f)
