B.x1=A.a(s(["The county attorney handed the wrapped quilt to the sheriff. The latter cast a quick, appraising glance for himself, his eyes scanning the bird with a practiced efficiency. \u201cIf Mr. Wright really did kill her bird--fool man!--it is conceivable may have wanted revenge. This may be the motive that has eluded us thus far.\u201d","The attorney nodded in agreement. \u201cIt is possible. In any case, it is evidence that should be presented to a court. I believe we have seen all we can here.\u201d"]),t.f)
